import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import "./NavbarDesktop.css";

class NavbarDesktop extends Component {
  render() {
    let pathname = this.props.location ? this.props.location.pathname : 'default';
    if (pathname === '/portfolio' || pathname === '/') {
        return (
            null
        );
    }
    return (
      <ul className='NavbarDesktop'>
        {this.props.menu.map(p => (
          <li className="nav-item">
          <NavLink exact activeClassName='Navbar-active' to={p.link} className="custom-underline" key={this.props.key}>
            {p.name}
          </NavLink>
        </li>
        ))}
      </ul>
    );
  }
}
export default NavbarDesktop;
